import org.apache.commons.io.IOUtils
import java.nio.charset.StandardCharsets
import java.lang.String

flowFile = session.get()
if(!flowFile) return

try {
  flowFile = session.write(flowFile, {inputStream, outputStream ->
    def originalBodyContent = IOUtils.toString(inputStream, StandardCharsets.UTF_8)

    def splittedLines = originalBodyContent.split("\n")

    def headerLine = "protocolo;viadeentrada;nomedatarefa;datadeabertura;canal;gestor;tipodemanifestacao;familiadeproduto;"
    headerLine = headerLine + "produtoservico;assuntoproblema;ativado;estado;proprietario;datadoorgao;dataaudiencia;datalocalizador;"
    headerLine = headerLine + "cpf;telefone1;telefone2;descricaomanifestacao;cliente;direcionamentoretbre;celula;fila;cep;logradouro;"
    headerLine = headerLine + "bairro;localidade;numero;complemento\r\n"

    splittedLines[0] = headerLine

    String newBody = ''

    splittedLines.each {
      newBody = newBody + it
    }

    outputStream.write(newBody.getBytes(StandardCharsets.UTF_8))

  } as StreamCallback)
  session.transfer(flowFile, REL_SUCCESS)

} catch(Exception e) {
  log.error('Error during JSON operations', e)
  session.transfer(flowFile, REL_FAILURE)
}

import org.apache.commons.io.IOUtils
