try {
  flowFile = session.write(flowFile, {inputStream, outputStream ->
    def originalBodyJson = new JsonSlurper().parseText(IOUtils.toString(inputStream, StandardCharsets.UTF_8))
    def newBodyJson = new JsonSlurper().parseText("[]")
    def caseTag = new JsonSlurper().parseText("{}")
    def newTag = new JsonSlurper().parseText("{}")
    def auxTag = new JsonSlurper().parseText("{}")
    def newList = new JsonSlurper().parseText("[]")
    def varViaEntrada = flowFile.getAttribute('viaEntrada')
    def varDataHoraCaptura = flowFile.getAttribute('dataHoraCaptura')

    originalBodyJson.each{
      newTag = new JsonSlurper().parseText("{}")
      newList = new JsonSlurper().parseText("[]")
      caseTag = new JsonSlurper().parseText("{}")
      auxTag = new JsonSlurper().parseText("{}")

      caseTag.put('cod_integracao','temporaryValue')
      caseTag.put('cod_conta','temporaryValue')

      //tag canal
      //if (it.viadeentrada != null) {
        //caseTag.put('canal',it.viadeentrada)
      //}

      //tag entidade //////////////////////////
        //endereco
      newTag = new JsonSlurper().parseText("{}")
      if (it.estado != null || it.localidade != null || it.bairro != null || it.logradouro != null || it.cep != null || it.numero != null || it.complemento != null) {
        if (it.estado != null) {
          newTag.put('uf',it.estado)
        }
        if (it.localidade != null) {
          newTag.put('localidade',it.localidade)
        }
        if (it.bairro != null) {
          newTag.put('bairro',it.bairro)
        }
        if (it.logradouro != null) {
          newTag.put('logradouro',it.logradouro)
        }
        if (it.cep != null) {
          newTag.put('cep',it.cep)
        }
        if (it.numero != null) {
          newTag.put('numero',it.numero)
        }
        if (it.complemento != null) {
          newTag.put('complemento',it.complemento)
        }
        auxTag.put('endereco',newTag)
        newTag = new JsonSlurper().parseText("{}")
        newTag << auxTag
        auxTag = new JsonSlurper().parseText("{}")
      }
        //demais tags
      if (it.cliente != null) {
        newTag.put('nome',it.cliente)
      }
      if (it.cpf != null) {
        newTag.put('cpfCnpj',it.cpf)
      }
      if (it.telefone1 != null) {
        newTag.put('telefoneCelular',it.telefone1)
      }
      if (it.telefone2 != null) {
        newTag.put('telefoneResidencial',it.telefone2)
      }

      if (newTag != null && newTag != "{}") {
        caseTag.put('entidade',newTag)
      }

      //tag caso //////////////////////////
      newTag = new JsonSlurper().parseText("{}")
      if (it.assuntoproblema != null) {
        newTag.put('assunto',it.assuntoproblema)
      }
      if (it.descricaomanifestacao != null) {
        newTag.put('mensagem',it.descricaomanifestacao)
      }
      if (it.protocolo != null) {
        newTag.put('idOrigem',it.protocolo)
      }
      if (it.datadeabertura != null) {
        newTag.put('dataHoraAbertura',it.datadeabertura)
      }
      //dataHoraCaptura
      if (varDataHoraCaptura != null) {
        newTag.put('dataHoraCaptura',varDataHoraCaptura)
      }
      if (it.canal != null) {
        newTag.put('canalEntrada',it.canal)
      }
      //viaEntrada
      if (varViaEntrada != null) {
        newTag.put('viaEntrada',varViaEntrada)
      }
      caseTag.put('caso',newTag)


      newBodyJson << caseTag
    }

    def newBodyContent = JsonOutput.toJson(newBodyJson)
    outputStream.write(JsonOutput.prettyPrint(newBodyContent).getBytes(StandardCharsets.UTF_8))
    //outputStream.write(text.getBytes(StandardCharsets.UTF_8))

  } as StreamCallback)
  session.transfer(flowFile, REL_SUCCESS)

} catch(Exception e) {
  log.error('Error during JSON operations', e)
  session.transfer(flowFile, REL_FAILURE)
}

